import { Breadcrumb } from "antd";

const BreadCrumb = ({list}) => {
    const breadcrumb = list.map(item => {
        return (
            <Breadcrumb.Item>{item.name}</Breadcrumb.Item>
        )
    })
    return (
        <Breadcrumb>
           {breadcrumb}
        </Breadcrumb>
    )

}

export default BreadCrumb;
